function Rooms() {
  return (
    <>
      <Hero hero="roomsHero">
        <Banner title="Rooms">
          <Link to="/" className="btn-primary">
            return Home
          </Link>
        </Banner>
      </Hero>
    </>
  );
}

export default Rooms;
